import React, { Component } from "react";
import about from './images/simonAboutImage.png';
import { Link } from "react-router-dom";
import Butter from 'buttercms';
import '../butterclient';

const butter = Butter('2fa7babaa7064c23b2cb90171957b2add0333e77')


export default class HomeView extends Component {
    constructor(props) {
        super(props);
        this.props = props;
        this.state = {};
      }

  render() {

    // eslint-disable-next-line
    return (
      <div className="pageWrapper">        
        <div className="pageTopDivider"></div>
        <div className="text-center">
        <Link to="/About" style={{color: 'black', "textDecoration":"none" }}>  
        <div className="siteShowCase">
          <ImageLoaderAbout />
            <p className="textTo">About Me</p>
        </div> 
        </Link>
        <div className="divider"></div>
        <Link to="/Photo" style={{color: 'black', "textDecoration":"none" }}>  
        <div className="siteShowCase">
        <ImageLoaderAbout />
            <p>Photography</p>
        </div> 
        </Link>
        <div className="divider"></div>
        <Link to="/CV" style={{color: 'black', "textDecoration":"none" }}>  
        <div className="siteShowCase">
            <p>CV</p>
        </div> 
        </Link>
        <div className="divider"></div>
        <Link to="/LeatherGoods" style={{color: 'black', "textDecoration":"none" }}>
        <div className="siteShowCase" 
        >

            <p>Leather Goods</p>
        </div>
        </Link>
        </div>
        <div className="divider"></div>
        <div className="divider"></div>
      </div>
    );
  }


}

function ImageLoaderAbout() {
  // Import result is the URL of your image
  return <img className="showCaseImage" src={about} alt="Logo" />;
}

function ImageLoaderPhotography() {
  // Import result is the URL of your image
  return <img className="showCaseImage" src={about} alt="Logo" />;
}
